Revizitează locurile în care ai fost explorând fotografiile care includ informații despre locație, inclusiv fotografiile trimise pe care le-ai salvat. Harta ta folosește informații despre locație precum:

 • sistemul GPS al camerei foto;
 • repere detectate.

Fotografiile și videoclipurile din Dosarul privat pentru care nu se face backup nu vor fi păstrate dacă:

 • schimbi dispozitivele;
 • revii la setările din fabrică ale dispozitivului;
 • ștergi aplicația Google Foto.

Google Foto va șterge definitiv următoarele date ale aplicației de pe dispozitiv: 

• conturile conectate; 
• setările; 
• fotografiile și videoclipurile din Dosarul privat pentru care nu s-a făcut backup. 

Fotografiile și videoclipurile din afara Dosarului privat și alte date ale aplicației nu vor fi șterse.
